  statusBuilder.show().when.valueInEncounter("Place of delivery").not.containsAnswerConceptName("Home");

    return statusBuilder.build();
};

'use strict';
({params, imports}) => {
  const programEncounter = params.entity;
  const formElement = params.formElement;

  const isHomeDelivery = programEncounter.getObservationReadableValue('Place of delivery');  

  let visibility = true;

  if(_.isEqual(isHomeDelivery,'Home'))
       visibility = false;

  const days = imports.moment(programEncounter.getObservationReadableValue('Date of discharge')).diff(programEncounter.getObservationReadableValue('Date of delivery'), 'days');
  const value = isFinite(days) ? days : undefined;
  return new imports.rulesConfig.FormElementStatus(formElement.uuid, visibility, value);  
  };

