//SAMPLE RULE EXAMPLE
  "use strict";
({params, imports}) => {
    const programEncounter = params.entity;
    const decisions = params.decisions;

    const complicationsBuilder1 = new imports.rulesConfig.complicationsBuilder({
        programEncounter: programEncounter,
        complicationsConcept: "Gestational age category at birth"
    });

    if (imports.motherCalculations.gestationalAgeCategoryAsOn) {
        const gestationaAge = imports.motherCalculations.gestationalAgeCategoryAsOn(programEncounter.findObservation("Date of delivery").getValue(), programEncounter.programEnrolment)

        complicationsBuilder1.addComplication(gestationaAge)
            .whenItem(true).is.truthy;

        decisions.encounterDecisions.push(complicationsBuilder1.getComplications());
    }


const complicationsBuilder = new imports.rulesConfig.complicationsBuilder({
        programEncounter: programEncounter,
        complicationsConcept: "High Risk Conditions"
    });

    complicationsBuilder.addComplication('Multiple Births')
        .when.valueInEncounter("Number of babies").is.greaterThan(1);


    decisions.encounterDecisions.push(complicationsBuilder.getComplications());


    return decisions;
};
